import { Search,Badge,MailIcon, ShoppingCartOutlined } from '@material-ui/icons';
import React from 'react'
import styled from 'styled-components';

const Container = styled.div`
    height: 60px;
`;

const Wrapper = styled.div`
    padding: 10px 20px;
    display: flex;
    align-items: center;
    justify-content: space-between;
`;

const Left = styled.div`
    flex: 1;
    display: flex;
    align-items: center;
`;
const Language = styled.span`
    font-size : 14px;
    cursor : pointer;
    display: flex;
    align-items: center;
`;
const SearchContainer = styled.div`
    border: 0.5px solid lightgray;
    display: flex;
    align-items: center;
    margin-left: 25px;
    padding: 5px;
`;

const Input = styled.input`
    border : none;
`;

const Logo = styled.h1`
    font-weight: bold;
`;

const Center = styled.div`
    flex:1;
    text-align: center;
`;
const Right = styled.div`
    flex:1;
`;

const MenuItem = styled.div`
    font-size: 14px;
    cursor: pointer;
`;

const Navbar = () => {
    
  return (
      <Container>
          <Wrapper>
              <Left>
                  <Language>
                      EN
                      <SearchContainer>
                          <Input />
                          <Search />
                      </SearchContainer>
                  </Language>
              </Left>
              <Center>
                  <Logo>Jong.</Logo>
              </Center>
              <Right>
                  <MenuItem>REGISTER</MenuItem>
                  <MenuItem>SIGN IN</MenuItem>
                  <MenuItem>
                      <Badge badgeContent={4} color="primary"> 
                          <ShoppingCartOutlined />

</Badge>
                </MenuItem>
              </Right>
        </Wrapper>
    </Container>
  )
}

export default Navbar
